  const listItems = items?.map(item=> (
    <table key={item.id}>
      <tr>
        <td>A</td>
        <td>B</td>
      </tr>
      <tr>
        <td>C</td>
        <td>D</td>
      </tr>
    </table>

  ))

  console.log(listItems)

